/****** Object:  StoredProcedure [dbo].[GetRecordChanges]    Script Date: 21.10.2022 14:01:21 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [dbo].[GetRecordChanges] 
    	@syncTime datetime2,
    	@tenantId nvarchar(1000),
    	@limit int = 50
    AS
    BEGIN
    	SET NOCOUNT ON;

    	WITH single_cte AS (SELECT * FROM [HistoricalView] WHERE ([PeriodEnd] > @syncTime and [PeriodEnd]<>'9999-12-31 23:59:59.9999999') OR [PeriodStart] > @syncTime),
    	group_cte AS
    	(
    	   SELECT [ID], [EntityType], max([PeriodEnd]) AS [PeriodEnd],
    			CASE WHEN min([PeriodEnd])='9999-12-31 23:59:59.9999999' THEN 'create' WHEN max([PeriodEnd])='9999-12-31 23:59:59.9999999' THEN 'update'  ELSE 'delete' END AS [Action]
    	   FROM	single_cte AS [All]
    	   WHERE [All].[TenantId] = @tenantId
    	   GROUP BY [All].[ID], [All].[EntityType] 
        )

    	SELECT TOP(@limit) [s].*, [g].[Action], IIF([s].[PeriodEnd] = '9999-12-31 23:59:59.9999999',  [s].[PeriodStart],[s].[PeriodEnd]) AS [SyncTime] FROM group_cte [g] 
    		LEFT JOIN single_cte [s] ON [g].[ID] = [s].[ID] and  [g].[EntityType] = [s].[EntityType] and [g].[PeriodEnd] = [s].[PeriodEnd]
    		ORDER BY [SyncTime] ;
    END
GO
/****** Object:  StoredProcedure [dbo].[UpdateHistoricalView]    Script Date: 21.10.2022 14:01:21 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [dbo].[UpdateHistoricalView] 
    	@tablesNames nvarchar(max),
    	@schema nvarchar(100) = 'dbo',
    	@tenantColumnName nvarchar(100),
    	@debug BIT = 0
    AS
    BEGIN
    	SET NOCOUNT ON;
    	DECLARE @prefix nvarchar(200) = 'CREATE OR ALTER VIEW ['+ @schema +'].[HistoricalView] AS SELECT [ID], [PeriodEnd], [PeriodStart], [EntityType], [Data], [TenantId] FROM ( '
    	DECLARE @suffix nvarchar(100) = ') AS [All]'

    	DECLARE @sqlCommand nvarchar(max) = ''
    	DECLARE @typeName nvarchar(100)
    	DECLARE @tableName nvarchar(100)
    	DECLARE @isFirstRow bit = 0
    	
    	IF @debug = 1 BEGIN
    		SELECT * FROM OPENJSON(@tablesNames) WITH ([entityType] nvarchar(100), [table] nvarchar(1000))
    	END

    	DECLARE table_cursor CURSOR  
    		FOR SELECT * FROM OPENJSON(@tablesNames) WITH ([entityType] nvarchar(100), [table] nvarchar(1000))
    	OPEN table_cursor  
    	
    	FETCH NEXT FROM table_cursor INTO @typeName , @tableName
    	WHILE @@FETCH_STATUS = 0  
    	BEGIN  
    		IF @isFirstRow = 1 BEGIN
    			SET @sqlCommand = @sqlCommand + ' UNION ALL '
    		END ELSE BEGIN
    			SET @isFirstRow = 1
    		END

    		SET @sqlCommand = @sqlCommand + '(SELECT *,( SELECT * FROM (SELECT *, [u].[PeriodEnd], [u].[PeriodStart], ''' + @typeName + ''' AS [EntityType], [u].[' + @tenantColumnName + '] as [TenantId] FROM ['+ @schema +'].['+ @tableName +'] FOR SYSTEM_TIME ALL as [u] ) js WHERE js.Id=reletionDb.Id AND js.PeriodEnd=reletionDb.PeriodEnd AND js.PeriodStart=reletionDb.PeriodStart FOR JSON AUTO, WITHOUT_ARRAY_WRAPPER  ) AS [Data] From (SELECT [u].[ID], [u].[PeriodEnd], [u].[PeriodStart], ''' + @typeName + ''' AS [EntityType], [u].[' + @tenantColumnName + '] as [TenantId] FROM ['+ @schema +'].['+ @tableName +'] FOR SYSTEM_TIME ALL as [u] ) reletionDb)'
    		FETCH NEXT FROM table_cursor INTO @typeName, @tableName
    	END
    	CLOSE table_cursor;  
    	DEALLOCATE table_cursor;  

    	IF @debug = 1 BEGIN
    		SELECT @prefix + @sqlCommand + @suffix AS Query
    	END

    	EXECUTE  (@prefix + @sqlCommand + @suffix)
    END
    
GO
